export const STATUS = {
    NOT_REQUESTED: 'notRequested',
    LOADING: 'loading',
    SUCCESS: 'success',
    ERROR: 'error',
}

export const PATH = {
    LOGIN: '/login',
    REGISTRATION: '/registration',
    ARTICLE: '/article',
    FEED: '/feed',
}
